import React from "react";
import {
  Box,
  Typography,
} from "@mui/material";

import ListItem from "./FullWidthTabs";

function Product() {
  return (
    <>
      <Box sx={{ px: 5, py: 3 }}  id="divProduct">
        <Typography variant="h4" textAlign="center">
          Product
        </Typography>
        <Box mt={3}>
          <ListItem />
        </Box>
        
      </Box>
    </>
  );
}
export default Product;
